        alert('You clicked me!');
    }

    return (
        <div className="Select">
            <div className="User">

                <div className="Gu" onClick={PcHand}>
                    <h1>✊</h1>

                </div>

                <div className="Cho" onClick={PcHand}>
                    <h1>✌️</h1>

                </div>

                <div className="Par" onClick={PcHand}>
                    <h1>✋</h1>

                </div>
            </div>

            <div className="Pc" onClick={PcHand}>

            {PcHand}

            </div>
            <button onClick={handleClick}>
                Click me
            </button>
        </div>

    );


};
